import "react-native-gesture-handler";
import * as React from "react";
import AsyncStorage from '@react-native-community/async-storage';
import { View, Image, Text ,TouchableOpacity, Dimensions} from "react-native";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";
import { createDrawerNavigator,DrawerContentScrollView, DrawerItem, DrawerItemList } from '@react-navigation/drawer';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { FontAwesome,FontAwesome5, AntDesign, MaterialIcons, Entypo } from '@expo/vector-icons';
import {useSelector,useDispatch} from 'react-redux';
import * as  donotallow from "./store/action/auth";
import {
   Confirmation,
   Dashboard,
   Login,
   Home,
   Profile,
   Signup,
   Liveclasses,
   Download,
   More,
   MathScreen,
   PdfRead,
   PlayVideo,
   Forgatepassword,
   Resetpassword,
   Subplan,
   BuyPackage,
   Notifications,
   HelpFacility,
   ShortVideo,
   ShareApp
  } from "./screens";

  import { TeacherHome, TeacherProfile, TeacherReply } from './screens/teacher';

 function ProfileStack(){
   const profilStack=createStackNavigator();
   return(
     <profilStack.Navigator>
       <profilStack.Screen 
         name="Profile"       
         component={Profile}
         options={{
          headerStyle:{
            backgroundColor:"#76E483"
          },
          headerTitle:"PROFILE",
          headerTitleStyle:{
            color:"#2F4858",
            fontFamily:"Rubik-Regular",
            fontSize:18
          },
          headerRight:()=>(
            <Text style={{color:"white",
                    fontFamily:"Rubik-Medium",
                    fontSize:12
          }}>Logout</Text>
          ),
          headerRightContainerStyle:{
            marginRight:25
          }
        }}
        />
        <profilStack.Screen 
         name="Subplan"       
         component={Subplan}
         />
     </profilStack.Navigator>
   )
 } 
 function HomeStack() {
    const childStack = createStackNavigator();
    return (
        <childStack.Navigator>
          <childStack.Screen name="home" component={Home} />
          <childStack.Screen
            name="MathScreen"
            component={MathScreen} 
            options={{
              headerStyle:{
                backgroundColor:"#76E483"
              },
              headerTitle:"MATHEMATICS",
              headerTitleStyle:{
                color:"#2F4858",
                fontFamily:"Rubik-Regular",
                fontSize:18
              },
              headerRight:()=>(
                <Text style={{color:"white",
                        fontFamily:"Rubik-Medium",
                        fontSize:12
              }}>Logout</Text>
              ),
              headerRightContainerStyle:{
                marginRight:25
              }
            }}
            />
          <childStack.Screen name="PlayVideo" component={PlayVideo} />
          <childStack.Screen name="PdfRead" component={PdfRead} />
          <childStack.Screen name="BuyPackage" component={BuyPackage} />
        </childStack.Navigator>
    );
  }

  function LoginStack(){
    const LoginStack=createStackNavigator();
    return(
      <LoginStack.Navigator>
        <LoginStack.Screen 
            name="Login"       
            component={Login} 
            options={{
              headerLeft:null,
              headerShown:null
            }}
          />
          <LoginStack.Screen 
            name="Forgatepassword"       
            component={Forgatepassword}
            options={{
              headerLeft:null,
              headerShown:null
            }}
          />
          <LoginStack.Screen 
            name="Resetpassword"       
            component={Resetpassword} 
            options={{
              headerLeft:null,
              headerShown:null
            }}
          />
          <LoginStack.Screen 
            name="Signup"       
            component={Signup} 
            options={{
              headerLeft:null,
              headerShown:null
            }}
          />
          <LoginStack.Screen 
            name="Confirmation"       
            component={Confirmation} 
            options={{
              headerLeft:null,
              headerShown:null
            }}
          />
      </LoginStack.Navigator>
    )
  }

  function HomePf({navigation}){
    const Tab = createBottomTabNavigator();
    return(
         <Tab.Navigator 
          tabBarOptions={{
            activeTintColor: 'green',
            style:{
              elevation: 5,   // here set your elevation
            }
          }}
           >
            <Tab.Screen name="home" component={HomeStack}
              options={{
                tabBarLabel: 'Home',
                tabBarIcon: ({ color, size,focused }) => (
                  <MaterialIcons name="home" size={30} color={color} focused={focused} /> 
                ),
              }}  
            />
            <Tab.Screen name="video" component={Liveclasses}
              options={{
                tabBarLabel: 'Liveclasses',
                tabBarIcon: ({focused, size ,tintColor,color}) => (
                  <FontAwesome5 name="video" size={24}  color={ color} focused={focused}/>
                )
              }}
            />
            <Tab.Screen name="subscription" component={ProfileStack} 
              options={{
                tabBarLabel: 'Subscription',
                tabBarIcon: ({ color, size ,focused}) => (
                  <MaterialIcons name="assignment-turned-in" size={24} color={color} focused={focused} />
                ),
              }}
            />
            <Tab.Screen name="notifications" component={Notifications}
              options={{
                tabBarLabel:'Notifications',
                tabBarIcon:({color, size, focused}) => (
